import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

const App = () => {
  return (
    <div className='app-wrapper row justify-content-center'>
      <header className='header col-xl-2'>
        <img src='karman.jpg'></img>
      </header>
      <nav className='nav col-xl-2'>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>
      <div className='content col-2'>
        Main content
      </div>
    </div>
  );
}
export default App;
